import React, { Component } from 'react';
import {
    Alert, Container, Row, Col, Table,
    Card, CardHeader, CardBody, CardText, CardTitle, CardFooter,
    Form, FormGroup, Label, Input, FormText, Button, Badge
} from 'reactstrap';

import TaskItem from './TaskItem';

class TaskList extends Component {
    render() {
        return (
            <Table bordered>
                <thead>
                    <tr>
                        <th>STT</th>
                        <th>Tên công việc</th>
                        <th>Trạng thái</th>
                        <th>Hành động</th>
                    </tr>
                </thead>
                <tbody>
                    <TaskItem/>
                </tbody>
            </Table>
        );
    }
}

export default TaskList;
